    //             console.log(response)
    //             return response.data
    //         })
    //         .then(data => { dispatch(setMovies(data)) })
    //         .catch(error => console.log(error));
    //     console.log('hola')
    // }, [changeValue])



    return (
        <div>
            <NavBar handleSubmit={handleSubmit} handleChange={handleChange} />
            <LastYearMovies />
        </div>
    )
}

export default Main
